import React, { useState } from 'react';
import FooterImg from '../assets/footer.webp';
import styled from 'styled-components';
import ReCAPTCHA from 'react-google-recaptcha';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faHeart } from '@fortawesome/free-solid-svg-icons';

const Container = styled.footer`
  position: relative;
  padding: 4em 1em 3em; 
  background: url(${FooterImg}) no-repeat center bottom;
  background-size: cover;
  z-index: -2;
  display: flex;

  @media (min-width: 768px) {
    padding: 8em 4em 5em;
  }
`;

const Title = styled.h2`
  color: #fff;
  font-family: Ruberoid;
  font-weight: 700;
  font-size: 2em;
  line-height: 1.2em;
  margin-bottom: 1em;

  @media (min-width: 768px) {
    font-size: 3em;
    margin-bottom: 1.5em;
  }
`;

const Newsletter = styled.div`
  display: flex;
  flex-direction: column;
  align-items: center;
  text-align: center;
  gap: 1em;

  input {
    width: 100%;
    max-width: 400px;
    padding: 1em;
    border: none;
    border-radius: 5px;
    font-size: 1em;
  }

  button {
    background: #000;
    color: #fff;
    font-family: Ruberoid;
    font-size: 1em;
    font-weight: 700;
    padding: 1em 2em;
    border: none;
    border-radius: 6px;
    cursor: ${({ disabled }) => (disabled ? 'not-allowed' : 'pointer')};
    transition: background 0.3s ease;

    &:hover {
      background: ${({ disabled }) => (disabled ? '#000' : '#333')};
    }
  }
`;

const LowerTitle = styled.h3`
  color: #fff;
  font-family: Ruberoid;
  font-size: 1.2em;
  margin-bottom: 1em;

  @media (min-width: 768px) {
    font-size: 1.5em;
  }
`;

const FlexContainer = styled.div`
  display: flex;
  flex-direction: column;
  gap: 2em;
  margin-top: 2em;

  @media (min-width: 768px) {
    flex-direction: row;
    justify-content: space-between;
  }
`;

const Column = styled.div`
  display: flex;
  flex-direction: column;
  text-align: center;
  gap: 0.5em;

  @media (min-width: 768px) {
    text-align: left;
  }
`;

const SubContainer = styled.p`
  color: #fff;
  font-size: 0.9em;
  line-height: 1.5;

  &:hover {
    color: #7b2bf9;
    cursor: pointer;
  }
`;

const Button = styled.button`
  border-radius: 8px;
  border: none;
  padding: 0.9em 1.5em;
  font-size: 1em;
  font-family: Ruberoid;
  background-color: #fff;
  color: #000;
  font-weight: bold;
  cursor: pointer;
  transition: background 0.3s ease;

  &:hover {
    background-color: #ebebeb;
  }
`;

const Acknowledgement = styled.p`
  text-align: center;
  color: #fff;
  font-size: 0.8em;
  margin-top: 2em;

  &:first-child {
    margin-top: 1em;
  }
`;

function Footer() {
  const [capVal, setCapVal] = useState(null);
  return (
    <Container>
      <Newsletter>
        <Title>Subscribe to our Newsletter</Title>
        <input type="email" placeholder="mail@celestia.com" />
        <ReCAPTCHA
          sitekey="6LeB8ZYqAAAAANAEy8OS9EjED1H--PSxkoKAddPk"
          onChange={(val) => setCapVal(val)}
        />
        <button disabled={!capVal}>Subscribe</button>
      </Newsletter>

        <div>
        <FlexContainer>
        <Column>
          <LowerTitle>Developers</LowerTitle>
          {['Build', 'Docs', 'Github', 'FAQ'].map((list, index) => (
            <SubContainer key={index}>{list}</SubContainer>
          ))}
        </Column>
        <Column>
          <LowerTitle>Resources</LowerTitle>
          {['Technology', 'Glossary', 'Blog', 'Podcast', 'Resources'].map(
            (list, index) => (
              <SubContainer key={index}>{list}</SubContainer>
            )
          )}
        </Column>
        <Column>
          <LowerTitle>Misc</LowerTitle>
          {[
            'Brand',
            'Press',
            'Careers',
            'Terms of Service',
            'Privacy Policy',
          ].map((list, index) => (
            <SubContainer key={index}>{list}</SubContainer>
          ))}
        </Column>
        <Column>
          <LowerTitle>Follow us</LowerTitle>
          <Button>View socials</Button>
        </Column>
      </FlexContainer>

      <Acknowledgement>
        This website is not maintained by Celestia Labs.
      </Acknowledgement>
      <Acknowledgement>
        Website designed with <FontAwesomeIcon icon={faHeart} /> by SI
      </Acknowledgement>
        </div>

    </Container>
  );
}

export default Footer;
